import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
    return (
        <nav style={{ backgroundColor: '#004085', padding: '10px' }}>
            <ul style={{ display: 'flex', justifyContent: 'space-around', listStyle: 'none', color: '#fff' }}>
                <li><Link to="/" style={{ color: '#fff', textDecoration: 'none' }}>Home</Link></li>
                <li><Link to="/events" style={{ color: '#fff', textDecoration: 'none' }}>Events</Link></li>
                <li><Link to="/register" style={{ color: '#fff', textDecoration: 'none' }}>Register</Link></li>
                <li><Link to="/feedback" style={{ color: '#fff', textDecoration: 'none' }}>Feedback</Link></li>
                <li><Link to="/login" style={{ color: '#fff', textDecoration: 'none' }}>Login</Link></li>
            </ul>
        </nav>
    );
};

export default Navbar;
